import './Main.css';
import Keyboard from './../keyboard/Keyboard';
import Solution from './../solution/Solution';




class Main extends React.Component {
   render() {
    return (
      <div>
        <header className="header">
          <h1>T I A S C O L T O</h1>
          <h2>Welcome</h2>
        </header>
        <div className="grid">
          <div className="item">
            <div>
                <Keyboard/>
            </div>
          </div>
            <div className="box">
              <Solution/>
            </div>
        </div>
      </div>
      );
  }
}

export default Main;
